import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const NavBar = ({ setShowContent }) => {
    const handleLinkClick = () => {
        setShowContent(false); // Set showContent to false when a link is clicked
    };
    return(
        <nav className="navbar navbar-expand-lg bg-white navbar-light sticky-top p-0 wow fadeIn">
            <a className="navbar-brand d-flex align-items-center px-4 px-lg-5" href="/">
            <h1>IKAA Hospital</h1>
            </a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarCollapse">
            <span className= "navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarCollapse">
            <ul className="navbar-nav ms-auto p-4 p-lg-0">
            <li className="nav-item">
                <a className="nav-link" href="#about">About</a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="#specialists-list">Services</a>
            </li>
            <li className="nav-item">
                <Link className="nav-link" to="/experts">Experts</Link>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="#Testimonials">Testimonials</a>
            </li>
            <li className="nav-item">
                <a className="nav-link" href="contact.html">Contact</a>
            </li>
            <li className="nav-item">
            <Link className="nav-link" to="/home">Doctor</Link>
            </li>
            </ul>
            </div>
      </nav>
    );
};

export default NavBar;
